import styled from 'styled-components';

export const Select = styled.div`
  position: relative;
  width: 150px;
  height: 30px;
  border: 1px solid #c2c2c2;
  border-radius: 5px;
  background-color: #fff;
  font-size: 14px;
  color: #666;
  overflow: hidden;
`;
export const Div = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 5px;
  cursor: pointer;
`;
